/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `sp_DisplaySurveyDetails`(_surveyCreatorID int,_categoryID int,_groupID int,_fromDate date,_toDate date)
BEGIN
IF (_categoryID  = 0  and _groupID = 0 and _fromDate is null and _toDate is null) THEN
	select s1.surveyID,s1.title as Title,count(s2.Response) as TotalResponses,s1.surveyCreatedDate,DATEDIFF(NOW(),s1.surveyExpiryDate)>0 as status from tbl_survey s1,tbl_surveyresponse s2 where s1.surveyId=s2.surveyId and s1.surveyCreatorID=_surveyCreatorID  group by s2.surveyId;
END IF;
IF (_categoryID  IS NOT NULL  and _groupID = 0 and _fromDate is null and _toDate is null) THEN
select s1.surveyID,s1.title as Title,count(s2.Response) as 
TotalResponses,s1.surveyCreatedDate,DATEDIFF(NOW(),s1.surveyExpiryDate)>0 from tbl_survey s1,tbl_surveyresponse s2 
where s1.surveyId=s2.surveyId and s1.surveyCreatorID=_surveyCreatorID and s1.categoryID=_categoryID group by s2.surveyId;

END IF;
IF (_categoryID  = 0 and _fromDate is null and _toDate is null  and _groupID IS NOT NULL) THEN
 select s1.surveyID,s1.title as Title,count(s2.Response) as TotalResponses,s1.surveyCreatedDate,DATEDIFF(NOW(),s1.surveyExpiryDate)>0 from tbl_survey s1,tbl_surveyresponse s2, tbl_sendtogroup sg where s1.surveyId=s2.surveyId and s1.surveyCreatorID=_surveyCreatorID and s1.surveyId=sg.SurveyId and sg.groupId=_groupID group by s2.surveyId; 

END IF;

IF (_categoryID  IS NOT NULL  and _groupID IS NOT NULL and _fromDate is null and _toDate is null) THEN
