/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `sp_InsertContactByExcel`(
_surveyTakerEmailID varchar(50),_mobileNumber varchar(10),
_alternateEmailID varchar(45),_userName varchar(45), _surveyCreatorID int(10)
)
BEGIN
 DECLARE count int;
select count(*) into count from tbl_user where surveyTakerEmailID = _surveyTakerEmailID 
and companyID = (select companyID from tbl_creator where surveyCreatorID = _surveyCreatorID);

if count<1 then
insert into tbl_user (surveyTakerEmailID,mobileNumber,alternateEmailID,userName,companyID)
values (_surveyTakerEmailID,_mobileNumber,_alternateEmailID,_userName,(select companyID from tbl_creator where surveyCreatorID = _surveyCreatorID));
end if;
select surveyTakerID from tbl_User where surveyTakerEmailID= _surveyTakerEmailID and companyID = (select companyID from tbl_creator where surveyCreatorID = _surveyCreatorID);
END */;;
