/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `sp_SendSurvey`(_surveyID int,_surveyTakerID int, _uniqueID varchar(50))
BEGIN
DECLARE count int;

select count(*) into count from tbl_surveytakers where surveyID = _surveyID 
and surveyTakerID =_surveyTakerID ;

if count<1 then
insert into tbl_surveyTakers(surveyID,surveyTakerID,uniqueID,completed,started)
values (_surveyID,_surveyTakerID,_uniqueID,0,0);
end if;
END */;;
